using nerderies.TelegramBotApi;
using nerderies.TelegramBotApi.DTOS;
using Newtonsoft.Json;
using NUnit.Framework;
using System;
using System.IO;
using System.Linq;

namespace Tests
{
    public class TestBot
    {
        private TelegramBot b = null;
        private Message _testMessage = null;

        [SetUp]
        public void Setup()
        {
            string token = null;
            DirectoryInfo documentsPath = null;
            try
            {
                documentsPath = new DirectoryInfo(Environment.GetFolderPath(Environment.SpecialFolder.Personal));
                var fileInfo = documentsPath.GetFiles("*.testtoken").First();
                token = File.ReadAllText(fileInfo.FullName).Trim();
                b = TelegramBot.GetBot(token, true);
                var updates = b.GetUpdates();
                _testMessage = updates.First();

            }
            catch(Exception)
            {
                throw new Exception($"You must first set up a test bot for integration testing and make sure that there is a *.testtoken file in {documentsPath}\rAlso, the bot should have at least one message in his backlog");
            }
            
        }

        [Test]
        public void GetMe_Returns_User()
        {
            var u = b.GetMe();
            Assert.IsNotNull(u);
            Assert.IsNotNull(u.FirstName);
            Assert.IsNotNull(u.Username);
            Assert.That(u.Id > 0);
            Assert.IsTrue(u.IsBot);  
        }

        [Test]
        public void SendMessage_Basic_Returns()
        {
            Assert.NotNull(b.SendMessage(_testMessage.Chat, "SendMessage_Basic_Returns") != null);
        }

        [Test]
        public void SendMessage_ReplyTo_Returns()
        {
            Assert.NotNull(b.SendMessage(_testMessage.Chat, "SendMessage_ReplyTo_Returns", replyToMessage: _testMessage));
        }

        [Test]
        public void SendMessage_HTML_Returns()
        {
            string testText = "<b>bold</b>, <strong>bold</strong>\n" +
                "<i>italic</i>, <em>italic</em>\n" +
                "<a href=\"http://www.example.com/\">inline URL</a>\n" +
                "<a href=\"tg://user?id=123456789\">inline mention of a user</a>\n" +
                "<code>inline fixed-width code</code>\n" +
                "<pre>pre-formatted fixed-width code block</pre>";

            Assert.NotNull(b.SendMessage(_testMessage.Chat, testText, TelegramBot.MarkdownStyles.HTML));
        }

        [Test]
        public void SendMessage_Markdown_Returns()
        {
            string testText ="*bold text*\n" +
                "_italic text_\n" +
                "[inline URL](http://www.example.com/)\n" +
                $"[inline mention of a user](tg://user?id={_testMessage.From.Id})\n" +
                "`inline fixed-width code`\n" +
                "```block_language\n" +
                "pre-formatted fixed-width code block ```";

            Assert.NotNull(b.SendMessage(_testMessage.Chat, testText, TelegramBot.MarkdownStyles.Markdown));
        }

        [Test]
        public void SendMessage_DisableWeb_Page_Preview_Returns()
        {
            Assert.NotNull(b.SendMessage(_testMessage.Chat, "no preview: check this out http://www.derstandard.at", disableWebPagePreview: true));
            Assert.NotNull(b.SendMessage(_testMessage.Chat, "preview: check this out http://www.derstandard.at", disableWebPagePreview: false));
        }

        [Test]
        public void ForwardMessage_Returns()
        {
            Assert.NotNull(b.ForwardMessage(_testMessage, _testMessage.Chat));
            Assert.NotNull(b.ForwardMessage(_testMessage, _testMessage.Chat, disableNotification: true));
        }

        [Test]
        public void SendPhoto_Returns()
        {
            string photo = "\"\"";
            byte[] bytes = JsonConvert.DeserializeObject<byte[]>(photo);

            var message = b.SendPhoto(_testMessage.Chat, new TelegramFile(bytes, "testimage", "img/gif"), caption: "caption", replyToMessage: _testMessage);
            Assert.NotNull(message);
            Assert.NotNull(message.Photos);
            Assert.NotNull(message.ReplyToMessage);
            Assert.That(message.Photos.Length > 0);
            var message2 = b.SendPhoto(_testMessage.Chat, new TelegramFile(message.Photos[0].FileId), caption:"*echo with markdown*", markdownStyle: TelegramBot.MarkdownStyles.Markdown);
            Assert.NotNull(message2);
            Assert.Null(message2.ReplyToMessage);
            Assert.That(message2.Photos.Length > 0);
        }

        [Test]
        public void SendChatAction_Returns()
        {
            Assert.True(b.SendChatAction(_testMessage.Chat, ChatAction.UploadDocument));
        }

        [Test]
        public void SendAudio_Returns()
        {
            string audio = "\"\"";
            string thumb = "\"\"";
            var m1 = b.SendAudio(_testMessage.Chat, new TelegramFile(JsonConvert.DeserializeObject<byte[]>(audio), "test", "audio/mpeg"), thumb: new TelegramFile(JsonConvert.DeserializeObject<byte[]>(thumb), "thumb", "img/jpeg"), performer: "cat", title: "testaudio");
            Assert.NotNull(m1);
        }
    }
}
